import ajax from './ajax'

// const BASE = 'http://localhost:8080'
const BASE = ''

export function reqLogin(phone, password) {
    ajax({
        method: 'post',
        url: BASE + '/user/login',
        data: {
            phone,
            password
        }
    })
}

